import heapq
from itertools import islice
def agen(): # generator of terms
    allowed = [2, 3, 4, 7, 8, 9]
    v, oldt, h, repunits, bigr = 1, 0, list((d, d) for d in allowed), [1], 1
    while True:
        v, d = heapq.heappop(h)
        if (v, d) != oldt:
            s = set(str(v))
            if len(s) == 9 and str(d) not in s:
                yield v
